import './App1.css';

function App1() {
  return (
    <div className="app1">
      <div className="search">
         <div id="search_icon"><img  src="https://assets.stickpng.com/images/585e4ae1cb11b227491c3393.png" alt=""></img></div>
          <div id="search_text">search</div>
      </div>
      <div className="graph_container">
          <div className="graph_box" >
            <div id="title">Sales Report September 2020</div>
            <div id="graph"><img src="https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcRULm-3ecLqBfFNcYrgHrFjFbmgafpzuceglA&usqp=CAU" alt=""/></div>
          </div>
          <div className="details">
                <h1>17 Se</h1>
          </div>
      </div>
    </div>
  );
}

export default App1;
